import React from "react";

// Import Components
import Home from "./Home";
import About from "./About";
import Contact from "./Contact";
import TFI from "./TFI";

const App = () => {
  return (
    <div>
      {/* Header Section */}
      <header style={{ display: "flex", alignItems: "center", padding: "10px" }}>
        <h1 style={{ flex: 1 }}>NSS Vasavi College of Engineering</h1>
        <img
          src="https://via.placeholder.com/100"
          alt="Logo"
          style={{ height: "50px" }}
        />
      </header>

      {/* Navigation Bar */}
      <nav style={{ backgroundColor: "#333", padding: "10px", position: "sticky", top: 0, zIndex: 1000 }}>
        <ul
          style={{
            display: "flex",
            listStyleType: "none",
            margin: 0,
            padding: 0,
            justifyContent: "space-around",
          }}
        >
          <li>
            <a
              href="#home"
              style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
            >
              Home
            </a>
          </li>
          <li>
            <a
              href="#about"
              style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
            >
              About
            </a>
          </li>
          <li>
            <a
              href="#contact"
              style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
            >
              Contact
            </a>
          </li>
          <li>
            <a
              href="#tfi"
              style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
            >
              TFI
            </a>
          </li>
        </ul>
      </nav>

      {/* Home Section */}
      <Home />

      {/* About Section */}
      <About />

      {/* Contact Section */}
      <Contact />

      {/* TFI Section */}
      <TFI />
    </div>
  );
};

export default App;
